fragment:
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:aromatic_compound rdfs:subClassOf :cyclic_compound ;
    :has_definition "A cyclically conjugated molecular entity with a stability (due to delocalization) significantly greater than that of a hypothetical localized structure (e.g. Kekule structure) is said to possess aromatic character." ;
    :has_exact_synonym "aromatic compounds",
        "aromatic molecular entity" ;
    :has_related_synonym "aromatics",
        "aromatische Verbindungen" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:s_block_molecular_entity rdfs:subClassOf :main_group_molecular_entity ;
    :has_definition "An s-block molecular entity is a molecular entity containing one or more atoms of an s-block element." ;
    :has_exact_synonym "s-block molecular entity" ;
    :has_related_synonym "s-block compounds",
        "s-block molecular entities" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:p_block_molecular_entity rdfs:subClassOf :main_group_molecular_entity ;
    :has_definition "A main group molecular entity that contains one or more atoms of a p-block element." ;
    :has_related_synonym "p-block compounds",
        "p-block molecular entities",
        "p-block molecular entitiy" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:d_block_molecular_entity rdfs:subClassOf :transition_element_molecular_entity ;
    :has_definition "A d-block molecular entity is a molecular entity containing one or more atoms of a d-block element." ;
    :has_exact_synonym "d-block molecular entity" ;
    :has_related_synonym "d-block compounds",
        "d-block molecular entities" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hydrides rdfs:subClassOf :heteroatomic_molecular_entity,
        :hydrogen_molecular_entity ;
    :has_definition "Hydrides are chemical compounds of hydrogen with other chemical elements." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:biomacromolecule rdfs:subClassOf :macromolecule,
        :organic_molecular_entity ;
    :has_definition "A macromolecule formed by a living organism." ;
    :has_exact_synonym "biopolymer" ;
    :has_related_synonym "Biopolymere",
        "biomacromolecules",
        "biopolymers" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:iron_group_molecular_entity rdfs:subClassOf :d_block_molecular_entity ;
    :has_exact_synonym "iron group molecular entity" ;
    :has_related_synonym "iron group molecular entities" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:macromolecule rdfs:subClassOf :polyatomic_entity ;
    :has_definition "A macromolecule is a molecule of high relative molecular mass, the structure of which essentially comprises the multiple repetition of units derived, actually or conceptually, from molecules of low relative molecular mass." ;
    :has_exact_synonym "macromolecule" ;
    :has_related_synonym "macromolecules",
        "polymer",
        "polymer molecule",
        "polymers" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:macronutrient rdfs:subClassOf :nutrient ;
    :has_definition "Any nutrient required in large quantities by organisms throughout their life in order to orchestrate a range of physiological functions. Macronutrients are usually chemical elements (carbon, hydrogen, nitrogen, oxygen, phosphorus and sulfur) that humans consume in the largest quantities. Calcium, sodium, magnesium and potassium are sometimes included as macronutrients because they are required in relatively large quantities compared with other vitamins and minerals." ;
    :has_related_synonym "macronutrients" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:azane rdfs:subClassOf :nitrogen_hydride ;
    :has_definition "Saturated acyclic nitrogen hydrides having the general formula NnHn+2." ;
    :has_related_synonym "azanes" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:oxoanion rdfs:subClassOf :oxide,
        :polyatomic_anion ;
    :has_definition "An oxoanion is an anion derived from an oxoacid by loss of hydron(s) bound to oxygen." ;
    :has_exact_synonym "oxoanion" ;
    :has_related_synonym "oxoacid anions",
        "oxoanions" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:subatomic_particle rdfs:subClassOf :material_entity ;
    :has_definition "A particle smaller than an atom." ;
    :has_related_synonym "subatomic particles" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:polyatomic_entity rdfs:subClassOf :molecular_entity ;
    :has_definition "Any molecular entity consisting of more than one atom." ;
    :has_related_synonym "polyatomic entities" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:polyatomic_ion rdfs:subClassOf :ion,
        :polyatomic_entity ;
    :has_definition "An ion consisting of more than one atom." ;
    :has_related_synonym "polyatomic ions" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cation rdfs:subClassOf :ion ;
    :has_definition "A monoatomic or polyatomic species having one or more elementary charges of the proton." ;
    :has_exact_synonym "Cation",
        "cation" ;
    :has_related_synonym "Kation",
        "Kationen",
        "cationes",
        "cations" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:organochalcogen_compound rdfs:subClassOf :chalcogen_molecular_entity,
        :heteroorganic_entity ;
    :has_definition "An organochalcogen compound is a compound containing at least one carbon-chalcogen bond." ;
    :has_exact_synonym "organochalcogen compound" ;
    :has_related_synonym "organochalcogen compounds" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:organooxygen_compound rdfs:subClassOf :organochalcogen_compound,
        :oxygen_molecular_entity ;
    :has_definition "An organochalcogen compound containing at least one carbon-oxygen bond." ;
    :has_exact_synonym "organooxygen compound" ;
    :has_related_synonym "organooxygen compounds" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mononuclear_parent_hydride rdfs:subClassOf :hydrides ;
    :has_exact_synonym "mononuclear parent hydrides" ;
    :has_related_synonym "mononuclear hydride",
        "mononuclear hydrides" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:heteroatomic_molecular_entity rdfs:subClassOf :polyatomic_entity ;
    :has_definition "A molecular entity consisting of two or more chemical elements." ;
    :has_related_synonym "chemical compound",
        "heteroatomic molecular entities" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mineral rdfs:subClassOf :chemical_substance ;
    :has_definition "In general, a mineral is a chemical substance that is normally crystalline formed and has been formed as a result of geological processes. The term also includes metamict substances (naturally occurring, formerly crystalline substances whose crystallinity has been destroyed by ionising radiation) and can include naturally occurring amorphous substances that have never been crystalline ('mineraloids') such as georgite and calciouranoite as well as substances formed by the action of geological processes on bigenic compounds ('biogenic minerals')." ;
    :has_exact_synonym "mineral" ;
    :has_related_synonym "Minerale",
        "minerales",
        "minerals",
        "mineraux" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:solvent rdfs:subClassOf :application,
        :chemical_role ;
    :has_definition "A liquid that can dissolve other substances (solutes) without any change in their chemical composition." ;
    :has_related_synonym "Loesungsmittel",
        "solvant",
        "solvents" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:onium_cation rdfs:subClassOf :onium_compound ;
    :has_definition "Mononuclear cations derived by addition of a hydron to a mononuclear parent hydride of the pnictogen, chalcogen and halogen families." ;
    :has_exact_synonym "onium cations" ;
    :has_related_synonym "onium cations",
        "onium ion",
        "onium ions" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:organic_molecular_entity rdfs:subClassOf :carbon_group_molecular_entity ;
    :has_definition "Any molecular entity that contains carbon." ;
    :has_related_synonym "organic compounds",
        "organic entity",
        "organic molecular entities" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:role rdfs:subClassOf :role ;
    :has_definition "A role is particular behaviour which a material entity may exhibit." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chemical_role rdfs:subClassOf :role ;
    :has_definition "A role played by the molecular entity or part thereof within a chemical context." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nitrogen_molecular_entity rdfs:subClassOf :pnictogen_molecular_entity ;
    :has_related_synonym "Nitrogenous compounds",
        "nitrogen compounds",
        "nitrogen molecular entities" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:heterocyclic_compound rdfs:subClassOf :cyclic_compound ;
    :has_definition "A cyclic compound having as ring members atoms of at least two different elements." ;
    :has_exact_synonym "Heterocyclic compound" ;
    :has_related_synonym "compuesto heterociclico",
        "compuestos heterociclicos",
        "heterocycle",
        "heterocyclic compounds" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chemical_substance rdfs:subClassOf :chemical_entity ;
    :has_definition "A chemical substance is a portion of matter of constant composition, composed of molecular entities of the same type or of different types." ;
    :has_related_synonym "Chemische Substanz" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mixture rdfs:subClassOf :chemical_substance ;
    :has_definition "A mixture is a chemical substance composed of multiple molecules, at least two of which are of a different kind." ;
    :has_related_synonym "Mischung" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:polymer rdfs:subClassOf :mixture ;
    :has_definition "A polymer is a mixture, which is composed of macromolecules of different kinds and which may be differentiated by composition, length, degree of branching etc.." ;
    :has_exact_synonym "Polymer" ;
    :has_related_synonym "Kunststoff" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:monovalent_inorganic_cation rdfs:subClassOf :inorganic_cation ;
    :has_definition "An atom or small molecule with a positive charge that does not contain carbon in covalent linkage, with a valency of one." ;
    :has_related_synonym "a monovalent cation" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:food_component rdfs:subClassOf :physiological_role ;
    :has_definition "A physiological role played by any substance that is distributed in foodstuffs. It includes materials derived from plants or animals, such as vitamins or minerals, as well as environmental contaminants." ;
    :has_related_synonym "dietary component",
        "dietary components",
        "food components" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:refrigerant rdfs:subClassOf :application ;
    :has_definition "A substance used in a thermodynamic heat pump cycle or refrigeration cycle that undergoes a phase change from a gas to a liquid and back. Refrigerants are used in air-conditioning systems and freezers or refrigerators and are assigned a \"R\" number (by ASHRAE - formerly the American Society of Heating, Refrigerating and Air Conditioning Engineers), which is determined systematically according to their molecular structure." ;
    :has_related_synonym "refrigerants" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:carbohydrates_and_carbohydrate_derivatives rdfs:subClassOf :organooxygen_compound ;
    :has_definition "Any organooxygen compound that is a polyhydroxy-aldehyde or -ketone, or a compound derived from one. Carbohydrates contain only carbon, hydrogen and oxygen and usually have an empirical formula Cm(H2O)n; carbohydrate derivatives may contain other elements by substitution or condensation." ;
    :has_related_synonym "carbohydrates and derivatives",
        "carbohydrates and their derivatives" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:divalent_inorganic_anion rdfs:subClassOf :inorganic_anion ;
    :has_definition "Any inorganic anion with a valency of two." ;
    :has_related_synonym "divalent inorganic anions" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:geographic_feature rdfs:subClassOf :astronomical_body_part ;
    :has_definition "An astrononmical body part which delimited by physical discontinuities with its surroundings."@en ;
    :has_exact_synonym "macroscopic spatial feature"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:bedding_plane_cave rdfs:subClassOf :cave ;
    :has_definition "A cavity developed along a bedding-plane and elongate in cross-section as a result."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:anthropogenic_geographic_feature rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :anthropisation ],
        :geographic_feature ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :geographic_feature ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :formed_as_result_of ;
                                    owl:someValuesFrom :anthropisation ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An anthropogenic geographic feature is a geographic feature resulting from the influence of human beings on nature."^^xsd:string ;
    :has_related_synonym "man-made feature"^^xsd:string,
        "manmade feature"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:mine_tailing rdfs:subClassOf :anthropogenic_environmental_material ;
    :has_broad_synonym "tailing"^^xsd:string ;
    :has_definition "Mine tailings are the materials left over after the process of separating the valuable fraction from the uneconomic fraction (gangue) of an ore."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:first_order_administrative_region rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :national_geopolitical_entity ],
        :administrative_region ;
    :has_definition "A primary administrative division of a country, such as a state in the United States."^^xsd:string ;
    :has_related_synonym "countries, 1st order division"^^xsd:string,
        "first level subdivision"^^xsd:string,
        "first-order administrative division"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:second_order_administrative_region rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :first_order_administrative_region ],
        :administrative_region ;
    :has_definition "A subdivision of a first-order administrative division."^^xsd:string ;
    :has_related_synonym "countries, 2nd order division"^^xsd:string,
        "second level subdivision"^^xsd:string,
        "second-order administrative division"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:third_order_administrative_region rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :second_order_administrative_region ],
        :administrative_region ;
    :has_definition "A subdivision of a second-order administrative division."^^xsd:string ;
    :has_related_synonym "barrio"^^xsd:string,
        "countries, 3rd order division"^^xsd:string,
        "third level subdivision"^^xsd:string,
        "third-order administrative division"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:fourth_order_administrative_region rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :third_order_administrative_region ],
        :administrative_region ;
    :has_definition "A subdivision of a third-order administrative division."^^xsd:string ;
    :has_related_synonym "countries, 4th order division"^^xsd:string,
        "fourth level subdivision"^^xsd:string,
        "fourth-order administrative division"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:national_geopolitical_entity rdfs:subClassOf :political_entity ;
    :has_definition "A political association with effective dominion over a geographic area."^^xsd:string ;
    :has_exact_synonym "nation"^^xsd:string ;
    :has_narrow_synonym "independent nation"^^xsd:string,
        "independent political entity"^^xsd:string,
        "independent sovereign nation"^^xsd:string ;
    :has_related_synonym "country"^^xsd:string,
        "political entity"^^xsd:string,
        "state"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:transport_feature rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :participates_in ;
            owl:someValuesFrom :usage_of_an_environment_for_transportation ],
        :human_construction ;
    :has_definition "A construction which enables the movement of humans, their animals or their vehicles."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:garden rdfs:subClassOf :anthropogenic_geographic_feature ;
    :has_definition "An enclosure for displaying selected plant or animal life."^^xsd:string ;
    :has_related_synonym "PARK"^^xsd:string,
        "cropland"^^xsd:string,
        "park"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:hydrographic_feature rdfs:subClassOf :geographic_feature ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :geographic_feature ;
                    rdf:rest [ rdf:first [ owl:unionOf [ rdf:first [ a owl:Restriction ;
                                                    owl:onProperty :partially_surrounded_by ;
                                                    owl:someValuesFrom :liquid_water ] ;
                                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                                            owl:onProperty :adjacent_to ;
                                                            owl:someValuesFrom :water_body ] ;
                                                    rdf:rest :nil ] ] ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A geographical feature associated with water."^^xsd:string ;
    :has_related_synonym "fluvial feature"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:cave_system rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :cave ],
        :surface_landform ;
    :has_definition "A collection of caves interconnected by enterable passages or linked hydrologically or a cave with an extensive complex of chambers and passages."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:canal rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :elongated ],
        :watercourse ;
    :has_definition "Artificial watercourse with no flow or a controlled flow used for navigation, drainage or irrigation."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:ocean rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :sea_water ],
        :marine_water_body,
        :saline_water_body ;
    :has_definition "A marine water body which is constitutes the majority of an astronomical body's hydrosphere."^^xsd:string ;
    :has_related_synonym "ocean region"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:sea rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :sea_water ],
        :marine_water_body,
        :saline_water_body ;
    :has_definition "A large expanse of saline water usually connected with an ocean."^^xsd:string ;
    :has_narrow_synonym "channel"^^xsd:string,
        "closed sea"^^xsd:string,
        "marginal sea"^^xsd:string,
        "open sea"^^xsd:string,
        "open sound"^^xsd:string,
        "open water"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:saline_hydrographic_feature rdfs:subClassOf :hydrographic_feature ;
    owl:equivalentClass [ owl:unionOf [ rdf:first [ owl:intersectionOf [ rdf:first :hydrographic_feature ;
                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                    owl:onProperty :adjacent_to ;
                                                    owl:someValuesFrom [ owl:intersectionOf [ rdf:first :water_body ;
                                                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                                    owl:onProperty :composed_primarily_of ;
                                                                                    owl:someValuesFrom :saline_water ] ;
                                                                            rdf:rest :nil ] ] ] ] ;
                                            rdf:rest :nil ] ] ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :partially_surrounded_by ;
                                    owl:someValuesFrom :saline_water ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A geographical feature associated with water with a halinity above 30 ppt (roughly 35 g/L)."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:saline_lake rdfs:subClassOf :lake,
        :saline_water_body ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :lake ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :composed_primarily_of ;
                                    owl:someValuesFrom :saline_water ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A lake whose water contains a considerable concentration of dissolved salts."^^xsd:string ;
    :has_exact_synonym "salt lake"^^xsd:string ;
    :has_related_synonym "salina"^^xsd:string,
        "soda lake"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:lake rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :partially_surrounded_by ;
            owl:someValuesFrom :planetary_landmass ],
        [ a owl:Restriction ;
            owl:onProperty :located_in ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :depressed_landform ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :part_of ;
                                            owl:someValuesFrom :planetary_landmass ] ;
                                    rdf:rest :nil ] ] ] ],
        :lentic_water_body ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :lentic_water_body ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :partially_surrounded_by ;
                                    owl:someValuesFrom :planetary_landmass ] ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :located_in ;
                                            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :depressed_landform ;
                                                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                            owl:onProperty :part_of ;
                                                                            owl:someValuesFrom :planetary_landmass ] ;
                                                                    rdf:rest :nil ] ] ] ] ;
                                    rdf:rest :nil ] ] ] ] ;
    :has_definition "A body of water or other liquid of considerable size contained in a depression on a landmass."^^xsd:string ;
    :has_narrow_synonym "catch basin"^^xsd:string,
        "open water"^^xsd:string,
        "tarn"^^xsd:string ;
    :has_related_synonym "broad"^^xsd:string,
        "llyn"^^xsd:string,
        "loch"^^xsd:string,
        "lochan"^^xsd:string,
        "lough"^^xsd:string,
        "mere"^^xsd:string,
        "mortlake"^^xsd:string,
        "pasteuer lake"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:freshwater_lake rdfs:subClassOf :fresh_water_body,
        :lake ;
    :has_definition "A lake of whose water contains low concentrations of salts."^^xsd:string ;
    :has_exact_synonym "FreshwaterLake"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:river rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :river_bank ],
        [ a owl:Restriction ;
            owl:onProperty :continuous_with ;
            owl:someValuesFrom :river_channel ],
        :stream ;
    :has_definition "A stream which, through permanent or seasonal flow processes, moves from elevated land towards lower elevations through a definite channel and empties either into a sea, lake, or another river or ends on land as bed seepage and evapotranspiration exceed water supply."^^xsd:string ;
    :has_exact_synonym "rio"^^xsd:string ;
    :has_narrow_synonym "braided river"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:stream rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :linear ],
        [ a owl:Restriction ;
            owl:onProperty :continuous_with ;
            owl:someValuesFrom :stream_channel ],
        :watercourse ;
    :has_broad_synonym "watercourse"^^xsd:string ;
    :has_definition "A watercourse which is linear and flows across the solid portion of a planetary surface."^^xsd:string ;
    :has_exact_synonym "streams"^^xsd:string ;
    :has_narrow_synonym "braided stream"^^xsd:string,
        "fork (hydrographic"^^xsd:string,
        "lode"^^xsd:string,
        "millstream"^^xsd:string,
        "stream bend"^^xsd:string,
        "streamlet"@en ;
    :has_related_synonym "Creek"^^xsd:string,
        "beck"^^xsd:string,
        "brook"^^xsd:string,
        "burn (hydrographic)"^^xsd:string,
        "creek"^^xsd:string,
        "rivulet"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:reservoir rdfs:subClassOf :artificial_lake ;
    :has_broad_synonym "lake"^^xsd:string ;
    :has_definition "An artificial body of water, often contained by a dam, constructed for the purpose of water storage."^^xsd:string ;
    :has_narrow_synonym "covered reservoir"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:well rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :tunnel ;
                            rdf:rest [ rdf:first :depressed_landform ;
                                    rdf:rest [ rdf:first :borehole ;
                                            rdf:rest :nil ] ] ] ] ],
        :anthropogenic_geographic_feature ;
    :has_definition "A cylindrical hole, pit, or tunnel drilled or dug down to a depth from which water, oil, or gas can be pumped or brought to the surface."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:spring rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :solid_surface_layer ],
        :surface_landform ;
    :has_definition "A surface landform which provides an egress for groundwater or steam to flow out of the ground."@en ;
    :has_related_synonym "seep"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:sand_pit_quarry rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :capable_of ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :material_extraction_process ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_output ;
                                            owl:someValuesFrom :sand ] ;
                                    rdf:rest :nil ] ] ] ],
        :quarry ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :quarry ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :capable_of ;
                                    owl:someValuesFrom [ owl:intersectionOf [ rdf:first :material_extraction_process ;
                                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                    owl:onProperty :has_output ;
                                                                    owl:someValuesFrom :sand ] ;
                                                            rdf:rest :nil ] ] ] ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A quarry from which sand is extracted."^^xsd:string ;
    :has_related_synonym "sand pit"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:dead_cave rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :dry ],
        :cave ;
    owl:disjointWith :live_cave ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cave ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_quality ;
                                    owl:someValuesFrom :dry ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A cave without streams or drips of water."^^xsd:string ;
    :has_exact_synonym "dry cave"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:wadi rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :contains_process ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :water_accumulation_process ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :discontinuous ] ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :contains_process ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :water_flow_process ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :discontinuous ] ;
                                    rdf:rest :nil ] ] ] ],
        :valley ;
    :has_definition "A valley or ravine, bounded by relatively steep banks, which in the rainy season becomes a watercourse."^^xsd:string ;
    :has_exact_synonym "wadis"^^xsd:string ;
    :has_narrow_synonym "wadi bend"^^xsd:string,
        "wadi junction"^^xsd:string,
        "wadi mouth"^^xsd:string ;
    :has_related_synonym "arroyo"^^xsd:string,
        "coulee"^^xsd:string,
        "gully"^^xsd:string,
        "nullah"^^xsd:string,
        "wash"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:bay rdfs:subClassOf :coastal_inlet ;
    :has_definition "An area of water bordered by land on three sides."^^xsd:string ;
    :has_related_synonym "bahia"^^xsd:string,
        "embayment"^^xsd:string,
        "firth"^^xsd:string,
        "inlet"^^xsd:string,
        "sea loch"^^xsd:string,
        "sea lough"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:pond rdfs:subClassOf :lentic_water_body ;
    :has_broad_synonym "lake"^^xsd:string ;
    :has_definition "A body of water, usually of smaller size than a lake."^^xsd:string ;
    :has_exact_synonym "Pond"^^xsd:string ;
    :has_narrow_synonym "pool (water body)"^^xsd:string ;
    :has_related_synonym "POOL"^^xsd:string,
        "millpond"^^xsd:string,
        "pond"^^xsd:string,
        "ponds"^^xsd:string,
        "pool"^^xsd:string,
        "pool (water body)"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:rapids rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :stream ],
        :hydroform ;
    :has_definition "An area of broken, fast flowing water in a stream, where the slope of the bed increases (but without a prominent break of slope which might result in a waterfall), or where a gently dipping bar of harder rock outcrops."^^xsd:string ;
    :has_related_synonym "cataract"^^xsd:string,
        "torrent"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:marsh rdfs:subClassOf :wetland_ecosystem ;
    :has_broad_synonym "wetland"^^xsd:string ;
    :has_definition "A wetland ecosystem which includes communities of grasses, rushes, reeds, typhas, sedges, and other herbaceous plants (possibly with low-growing woody plants)."^^xsd:string ;
    :has_related_synonym "Marsh"^^xsd:string,
        "marsh"^^xsd:string,
        "quagmire"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:irrigation_canal rdfs:subClassOf :canal ;
    :has_broad_synonym "canal"^^xsd:string ;
    :has_definition "Artificial watercourse with no flow or a controlled flow used irrigation."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:ditch rdfs:subClassOf :artificial_channel ;
    :has_definition "A small, human-made channel which has been dug for draining or irrigating the land."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:lagoon rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :coastal_wetland_ecosystem ],
        [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :saline_water ],
        [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :shore ],
        :aquatic_layer ;
    :has_definition "A sheet of saline water separated from the open sea by sand or shingle banks. The sheet of water between an offshore reef, especially of coral and mainland. The sheet of water within a ring or horseshoe shaped atoll."^^xsd:string ;
    :has_exact_synonym "lagoons"^^xsd:string,
        "laguna"^^xsd:string ;
    :has_related_synonym "barrier lagoon"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:fjord rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :slope ],
        [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :glacial_erosion_process ],
        [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :elongated ],
        :coastal_inlet ;
    :has_definition "A long and narrow sea inlet with high steeply sloped walled sides. A fjord is a landform created during a period of glaciation."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:waterfall rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :stream ],
        :hydroform,
        :lotic_water_body ;
    :has_definition "A sudden descent of water over a step or ledge in the bed of a river."^^xsd:string ;
    :has_exact_synonym "WATERFALL"^^xsd:string,
        "force"^^xsd:string,
        "linn"^^xsd:string,
        "waterfalls"^^xsd:string ;
    :has_related_synonym "cascade"^^xsd:string,
        "cataract"^^xsd:string,
        "fall"^^xsd:string,
        "falls"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:tidal_creek rdfs:subClassOf :tidal_watercourse ;
    :has_broad_synonym "stream"^^xsd:string ;
    :has_definition "A tidal water channel. Creeks may often dry to a muddy channel with little or no flow at low tide, but often with significant depth of water at high tide."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:drainage_canal rdfs:subClassOf :canal ;
    :has_broad_synonym "canal"^^xsd:string ;
    :has_definition "Artificial watercourse with no flow or a controlled flow used drainage."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:wetland_area rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :wetland_ecosystem ],
        :vegetated_area ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :vegetated_area ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :overlaps ;
                                    owl:someValuesFrom :wetland_ecosystem ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An vegetated area which overlaps a wetland ecosystem."^^xsd:string ;
    :has_related_synonym "WetlandRegion"^^xsd:string .
